import React from "react";
import ReactDOM from "react-dom";

function ping() {
    fetch('../api')
      .then(response => response.text())
      .then(data => {return data});
}


ReactDOM.render(
    <div>
        <div>This page was served statically</ div>
        <div>{ping()}</div>
    </div>,
    document.getElementById('root')
);
